import React, { Component } from 'react';
import PropTypes from 'prop-types';

class VideoList extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { videos } = this.props;
    return <div>{videos.length}</div>;
  }
}

export default VideoList;
